import React from 'react';
import './ExpenseList.css';

const ExpenseList = () => {
  // Mock data - replace with actual data from your backend
  const totalAmount = 1325.00;
  const owedAmount = 2000.00;

  const expenses = [
    {
      id: 1,
      description: 'Trip to Maui',
      members: ['kyle', 'brian', 'chris'],
      amount: 500,
      avatar: 'https://via.placeholder.com/40'
    },
    {
      id: 2,
      description: 'Electric bill',
      members: ['kyle'],
      amount: 275,
      avatar: 'https://via.placeholder.com/40'
    },
    {
      id: 3,
      description: 'Trip to Maui',
      members: ['kyle', 'brian', 'chris'],
      amount: 300,
      avatar: 'https://via.placeholder.com/40'
    },
    {
      id: 4,
      description: 'Electric bill',
      members: ['kyle'],
      amount: 250,
      avatar: 'https://via.placeholder.com/40'
    }
  ];

  return (
    <div className="expense-list-container">
      <header className="header">
        <div className="header-left">
          <h1>Spend Together</h1>
        </div>
        <div className="header-right">
          <button className="settings-btn">⚙️</button>
        </div>
      </header>

      <div className="expense-summary">
        <h2 className="total-amount">Total ${totalAmount.toFixed(2)}</h2>
        <p className="owed-amount">You are owed ${owedAmount.toFixed(2)}</p>
      </div>

      <div className="expenses-list">
        {expenses.map((expense) => (
          <div key={expense.id} className="expense-item">
            <div className="expense-left">
              <img src={expense.avatar} alt="" className="expense-avatar" />
              <div className="expense-details">
                <h3 className="expense-description">{expense.description}</h3>
                <p className="expense-members">
                  {expense.members.map(member => `@${member}`).join(', ')}
                </p>
              </div>
            </div>
          </div>
        ))}
      </div>

      <footer className="footer">
        <a href="/privacy" className="footer-link">Privacy policy</a>
        <a href="/terms" className="footer-link">Terms of service</a>
      </footer>
    </div>
  );
};

export default ExpenseList;
